    /// </summary>
    private async Task SaveCurrentFilter()
    {
        try
        {
            await FilterServices.SaveCustomFilterAndConditions(
                SimpleQuotationService.GetFieldValues(FilterData),
                filterConditionFormName,
                userLoginId
            );
        }
        catch (Exception)
        {
            throw;
        }
